    pre = [0] / (N + 1)
    sum = 0
    for i in range(1, N + 1):
        sum += A[i - 1]
        pre[i] = sum
    factors = []
    i = 1
    while i * i <= X:
        if X % i == 0:
            factors.append(i)
            if i * i != X:
                factors.append(X // i)
        i += 1
    ans = 0
    for a in factors:
        if a > N:
            continue
        z = X // a
        dict = {}
        for j in range(a, N + 1):
            s = pre[j] - pre[j - a]
            if s > z:
                continue
            if s in dict:
                dict[s] += 1
            else:
                dict[s] = 1
        for j in range(a, N + 1):
            s = pre[j] - pre[j - a]
            if s > z:
                continue
            if z - s in dict:
                ans += dict[z - s]
        for j in range(a, N + 1):
            s = pre[j] - pre[j - a]
            if s > z:
                continue
            dict[s] = 0
    return ans

